localized.description:
В этом выпуске:
- Мировая пресса обсуждает сколько раз Путин и Байден пожали руки;
- Эрдоган в Азербайджане. Две страны уже подписали соглашение о военном альянсе;
- Израильские ВВС снова утюжат сектор Газа;
- США и Евросоюз объявили об окончании торговой войны;
- В России снова больше 13 тысяч заболевших ковидом за сутки;
- Цены на квартиры растут из-за пандемии, а не из-за льготной ипотеки – убеждён вице-премьер Хуснуллин;
- Дизтопливо на российской бирже подорожало до исторического максимума – 52600 за тонну, с мая – плюс 5%;
- Стресс на рабочем месте оказался одним из факторов, влияющих на глобальную экономику;
- За 4 года число эксплуатируемых несовершеннолетних увеличилось на 8 миллионов;
- Магазин ИКЕА во Франции оштрафовали на миллион евро;
- В Ростове прекратили одно из дел печально известной банды Цапков;
- В правительстве обсуждают идею создания единой системы видеонаблюдения. 


